css:
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 14px;
  font-weight: 600;
  border-top: 1px solid #1e1e1e;
  border-bottom: 1px solid #1e1e1e;
}
.github-UnstagedChanges > .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: #797979;
  margin-right: 11.66666667px;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 14px;
  font-weight: normal;
  border-left: 1px solid #1e1e1e;
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: #797979;
}
.github-StagingView-headerButton:active {
  background-color: #454545;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid #1e1e1e;
}
.github-StagingView-headerButton--iconOnly:before {
  width: auto;
}
.github-StagingView-title {
  flex: 1;
  margin-right: 14px;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 7px 14px;
}
.github-StagingView-group.is-focused .is-selected {
  color: #FFFFFF;
  background: #404040;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: #6D9CBE;
}
